import React from 'react';
import axios from 'axios';
import { useState } from 'react';

export default function FormatData() {

    const [orderNumber, setOrderNumber] = useState('');

    const [data, setData] = useState([]);

    const [loading, setLoading] = useState(false);

    const handleFetchData = () => {

      setLoading(true);

      axios
        .get('http://localhost:9000/aliens/')

        .then(response => {

          if (response.status === 200) {

            setData(response.data);

          } else {

            alert('An error occurred');

          }
        })
        .catch(error => {

          console.log('Error', error);

        })

        .finally(() => {

          setLoading(false);

        });

    };

    const filteredData = data.filter(item => {

      return item.query.query_string.order_number === orderNumber;

    });

    return (
      <div className='container'>

        <label className='label' htmlFor='ON'>
          ON:
        </label>

        <input

          type='text'

          value={orderNumber}

          onChange={e => setOrderNumber(e.target.value)}

          placeholder='Enter order number'

          className='input'
        />

        <button className='btn' onClick={handleFetchData}>

          Fetch Data
        </button>

        {loading && <p>Loading...</p>}

        {filteredData.length > 0 ? (

          filteredData.map((item, index) => (

            <pre key={index} className='json-format'>

              {JSON.stringify(item, null, 2)}

            </pre>
          ))
        ) : (
          <p>No data found</p>
        )}
      </div>
    );
  }
